import {Route} from 'react-router-dom';
import AllMeetupsPage from './pages/AllMeetups';
import NewMeetupsPage from './pages/NewMeetup';
import FavsPage from './pages/Favs';

function App() {

  // localhost:3000/
  //www.
  return (
    <div className="dark:bg-gray-800 font-urbanist">
      <Route path="/" exact>
        <AllMeetupsPage />
      </Route>
      <Route path="/new-meetup">
        <NewMeetupsPage />
      </Route>
      <Route path="/favs">
        <FavsPage />
      </Route>
    </div>
  );
}

export default App;
